		// et montre / cache le bouton OK
		function updateOkVisibility() {
		    let allOk = true;
		
		    for (let i = 0; i < requiredForOk.length; i++) {
		        const name = requiredForOk[i];
		        const cb = checkboxes[name];
		        if (!cb || !cb.isChecked) {
		            allOk = false;
		            break;
		        }
		    }
		
		    scope.btn_avis_ok.visible = allOk;
		}
		
